So,  I ran a few tests in 5.0.4 to see what behaviour it has.  I know ZF targets 5.1, but i haven't gotten around to upgrading yet. :)

I wrote these:
{code:title=Test Objects}
class TestOne
{
	private $variables = array();

	public function __get($offset)
	{
		return $this->variables[$offset];
	}
	public function __set($offset, $value)
	{
		$this->variables[$offset] = $value;
	}
	public function __isset($offset)
	{
		return isset($this->variables[$offset]);
	}
	public function __unset($offset)
	{
		unset($this->variables[$offset]);
	}
}

class TestTwo implements ArrayAccess
{
	private $variables = array();

	public function offsetExists($offset)
	{
		return isset($this->variables[$offset]);
	}
	public function &offsetGet($offset)
	{
		return $this->variables[$offset];
	}
	public function offsetSet($offset, $value)
	{
		$this->variables[$offset] = $value;
	}
	public function offsetUnset($offset)
	{
		unset($this->variables[$offset]);
	}
}

class TestThree
{
	private $variables = array();

	public function __get($offset)
	{
		return (isset($this->variables[$offset]) ? $this->variables[$offset] : null);
	}
	public function __set($offset, $value)
	{
		$this->variables[$offset] = $value;
	}
	public function __isset($offset)
	{
		return isset($this->variables[$offset]);
	}
	public function __unset($offset)
	{
		unset($this->variables[$offset]);
	}
}
{code}

And tested them with this:
{code:title=Test Code}
$one = new TestOne();
$one->bob = 'tom';
$one->people = array();
$one->people['bob'] = 'tom';
$one->guys[] = 'tom';
Zend::dump($one);

$two = new TestTwo();
$two['bob'] = 'tom';
$two['people'] = array();
$two['people']['bob'] = 'tom';
$two['guys'][] = 'tom';
Zend::dump($two);

$three = new TestThree();
$three->bob = 'tom';
$three->people = array();
$three->people['bob'] = 'tom';
$three->guys[] = 'tom';
Zend::dump($three);
{code}

And this is what I got:
{code:title=Response}
Notice: Undefined index: guys in {This happened in the TestOne Object __get call}

object(TestOne)#71 (1) {
  ["variables:private"] => array(2) {
    ["bob"] => string(3) "tom"
    ["people"] => array(1) {
      ["bob"] => string(3) "tom"
    }
  }
}

object(TestTwo)#72 (1) {
  ["variables:private"] => array(3) {
    ["bob"] => string(3) "tom"
    ["people"] => &array(1) {
      ["bob"] => string(3) "tom"
    }
    ["guys"] => &array(1) {
      [0] => string(3) "tom"
    }
  }
}

object(TestThree)#73 (1) {
  ["variables:private"] => array(2) {
    ["bob"] => string(3) "tom"
    ["people"] => array(0) {
    }
  }
}
{code}

And as a side note, I mentioned an issue on the zf-general mailing list about Zend Platform modifying the behaviour of ternary statements.
This is best demonstrated if I show you the output from TestOne and TestThree with Zend Platform turned on:
{code:title=Zend Platform Weirdness}
object(TestOne)#72 (1) {
  ["variables:private"] => array(2) {
    ["bob"] => string(3) "tom"
    ["people"] => array(1) {
      ["bob"] => string(3) "tom"
    }
  }
}

object(TestThree)#74 (1) {
  ["variables:private"] => array(2) {
    ["bob"] => string(3) "tom"
    ["people"] => array(1) {
      ["bob"] => string(3) "tom"
    }
  }
}
{code}
The only change to produce the above output was turning Zend Platform on in my php.ini
